    return (
        <li>
            <Card>
                <Image
                    src="https://react.semantic-ui.com/images/avatar/large/matthew.png"
                    wrapped
                    ui={false}
                />
                <Card.Content>
                    <Card.Header>nthng</Card.Header>
                    <Card.Description>Artist</Card.Description>
                </Card.Content>
            </Card>
        </li>
    );
};

export default CardItem;
